import React from 'react';
import './App.css';

const HeroSection = () => {
  return (
    <section className="hero">
      <div className="container">
        <h1>Staff Augmentation Services</h1>
        <p>Get the best talent for your projects</p>
        <button>Get Started</button>
      </div>
    </section>
  );
};

export default HeroSection;
